// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "./utils/time.sol";

contract UMRproposal {
    using Time for Time.Timestamp;

    struct ProposalCore {
        Time.Timestamp donationStart;
        Time.Timestamp donationEnd;
        uint256 donateMinimum;
        bool executed;
        bool canceled;
    }

    mapping(uint256 => ProposalCore) private _proposals;

    function hashProposal(
        address proposer,
        address destination,
        bytes[] memory calldatas,
        bytes32 descriptionHash
    ) public pure returns (uint256) {
        return uint256(keccak256(abi.encode(proposer,destination, calldatas, descriptionHash)));
    }

    function proposal(
        address proposer, // 제안자 
        uint256 donateDelay, // n * 13.5s 후 기부 시작
        uint256 donatePeriod, // n * 13.5s 후 기부 종료 //45818 = 1 week
        uint256 donateMinimum, // 0.5 = 0.5ETH
        address destination, // 기부단체 주소
        string memory description, // 기부 안건 내용
        bytes[] memory calldatas // execute 시 발동될 스마트컨트렉트
    ) public returns(uint256) {
        // 안건 번호 생성
        uint256 proposalId = hashProposal(proposer,destination, calldatas, keccak256(bytes(description)));

        ProposalCore storage proposal = _proposals[proposalId];

        uint256 snapshot =  block.timestamp + donateDelay*24*60*60;
        uint256 deadline = snapshot + donatePeriod*24*60*60;

        proposal.donationStart.setDeadline(snapshot);
        proposal.donationEnd.setDeadline(deadline);
        proposal.donateMinimum = donateMinimum;

        return proposalId;
    }
}

// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

library Time {
    struct Timestamp {
        uint256 deadline;
    }
    /* 
    @dev 현재시간 milliseconds
    **/
    function currentTime(Timestamp storage time) public returns(uint256) {
        return time.deadline =  block.timestamp * 1000;
    }

    function setDeadline(Timestamp storage time, uint256 timestamp) internal {
        time.deadline = timestamp;
    }

    function getDeadline(Timestamp memory time) internal pure returns(uint256) {
        return time.deadline;
    }



}

